Ext.data.JsonP['Managing_Client_Applications']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Managing Client Applications</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-43298774\" class=\"content\">\n                        <h1>Managing Client Applications</h1>\n    <p>This document provides information on app overview and service keys, what the API Builder, test, and performance tabs entail, how to view real-time and aggregated analytics, and managing application team members.    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-AppOverviewandServiceKeys\">App Overview and Service Keys</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-APIBuilderTab\">API Builder Tab</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-TestTab\">Test Tab</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-PerformanceTab\">Performance Tab</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-ViewingReal-timeandAggregatedAnalytics\">Viewing Real-time and Aggregated Analytics</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Managing_Client_Applications-section-src-43298774_ManagingClientApplications-ViewingandManagingApplicationTeamMembers\">Viewing and Managing Application Team Members</a>    </p>\n</li></ul>    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-AppOverviewandServiceKeys\">\n        <h2 class=\"heading \"><span>App Overview and Service Keys</span></h2>\n    <p>When you select a client application from the Apps menu, or from the list of all applications, it&apos;s Overview page opens. The Overview screen displays basic information about the application including its name, description, and application GUID. It also includes link to <a class=\"document-link \" href=\"#!/guide/Appcelerator_Dashboard-section-src-43298769_AppceleratorDashboard-KeyMetrics\">key metrics</a> collected by the Analytics service.    </p>\n    <p>For Titanium applications, the Overview screen also specifies the <strong class=\" \">App ID</strong> and <strong class=\" \">SDK Version</strong> assigned to the application when it was created.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.08.45_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.08.45_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    <p>Native iOS and Android applications include the same basic information on an <strong class=\" \">App Info</strong> tab as for Titanium applications. Additionally, the <strong class=\" \">Services</strong> contains your API service key for the Cloud, Performance, and Analytics services, and if they are currently enabled for your application status. important information about the status of the various Platform services: Cloud, Performance, Analytics, and Test.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/overview_native.png\" alt=\"images/download/attachments/43298774/overview_native.png\" class=\"gliffy-macro-image\" width=\"892\">\n        </img></p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-APIBuilderTab\">\n        <h2 class=\"heading \"><span>API Builder Tab</span></h2>\n    <p>The API Builder tab lists the Mobile Backend Services (<strong class=\" \">Data</strong>) and API Builder (<strong class=\" \">Service</strong>) APIs in use by the application. Click an item in the list to view or manage its services. See <a class=\"document-link \" href=\"#!/guide/Managing_Mobile_Backend_Services_Datasources\">Managing Mobile Backend Services Datasources</a> for details.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/app-apis-2.png\" alt=\"images/download/attachments/43298774/app-apis-2.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-TestTab\">\n        <h2 class=\"heading \"><span>Test Tab</span></h2>\n    <p>The <strong class=\" \">Test</strong> tab provides access to the Appcelerator Test service dashboard. Once you&apos;ve enabled the Test service in your application and installed the TouchTest agent on a device or emulator, this screen lets you record, playback and analyze test compositions run on the target device. For details on using the Test service information, see <a class=\"document-link \" href=\"#!/guide/Getting_started_with_Test\">Getting started with Test</a>.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.09.25_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.09.25_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-PerformanceTab\">\n        <h2 class=\"heading \"><span>Performance Tab</span></h2>\n    <p>The <strong class=\" \">Performance</strong> tabs lets you view details about application crashes and handled exceptions. For details, see <a class=\"document-link \" href=\"#!/guide/Managing_Performance_and_Crash_Data\">Managing Performance and Crash Data</a>.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/perf.png\" alt=\"images/download/attachments/43298774/perf.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-ViewingReal-timeandAggregatedAnalytics\">\n        <h2 class=\"heading \"><span>Viewing Real-time and Aggregated Analytics</span></h2>\n    <p>The Analytics tab displays real-time analytics, such as the number of active sessions, average session length, and number of installs, by platform and geography.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.10.33_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.10.33_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    <p>You can also view custom events captured by your application using the <a class=\"external-link external-link\" href=\"#!/api/Titanium.Analytics\">Titanium.Analytics</a> object, or the performance APIs provided by the Platform Services SDK for <a class=\"document-link \" href=\"#!/guide/APS_Analytics_for_iOS\">iOS</a> or <a class=\"document-link \" href=\"#!/guide/APS_Analytics_for_Android\">Android</a>.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.11.47_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.11.47_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    <p>You can define event funnels, or custom, ordered collections of captured events that track a particular user or business process, such as a sales funnel (browse, select, checkout, for example).    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.12.32_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.12.32_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    <p>For more information, see <a class=\"document-link \" href=\"#!/guide/Viewing_Analytics\">Viewing Analytics</a>.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43298774_ManagingClientApplications-ViewingandManagingApplicationTeamMembers\">\n        <h2 class=\"heading \"><span>Viewing and Managing Application Team Members</span></h2>\n    <p>The <strong class=\" \">Teams</strong> tab lets you add organization members to the application team, and set their role (member or admin), as well as remove current team members.    </p>\n    <p>    <img src=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.24.41_PM.png\" alt=\"images/download/attachments/43298774/Screen_Shot_2015-03-31_at_5.24.41_PM.png\" class=\"confluence-embedded-image\" width=\"500\">\n        </img></p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=43298774\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Managing Client Applications"});